description:
The Witcher Adventure Game takes players on a journey across the
world of the Witcher as they assume the roles of four distinct
characters known from the books and video games: Geralt of Rivia
monster slayer; Triss Merigold, cunning sorceress; Yarpen Zigrin
dwarven warrior; and Dandelion, roguish bard. Each character has
unique skills and multiple ways of overcoming obstacles - the
choice is yours: do you fight your way to victory, call on your
charm or try your hand at diplomacy?

